INSERT INTO `donation_project` VALUES (1,'Shomolu is a residential suburb in Lagos. Shomolu is plagued by problems of overcrowding, poor housing, and inadequate sanitation. According to an article published in the Journal of Public Health in Africa, only 33.8% of households in Shomolu are food secure, 45.1% are food insecure without hunger and 21.1% are food insecure with hunger.','Shomolu','Shomolu',0.00,1,'shomolu.jpg','1',NULL,NULL,'shomolu',NULL),(2,'Alimosho is the largest local government in Lagos, with over 1.2 million inhabitants.  There have been state and federally coordinated interventions to alleviate the hunger situation in the poor district of Alimosho, however, these have been too little to feed the hungry mouths spread across a city such as Alimosho where poverty is prevalent.','Alimosho','Alimosho',0.00,1,'default_1.jpg','1',NULL,NULL,'alimosho',NULL),(3,'Ikorodu is a city located in the north-east of Lagos State, Nigeria. It is located along the Lagos Lagoon and shares a boundary with Ogun State. Many residents of Ikorodu are artisans and traders who have been severely impacted by the economic downturn as a result of the COVID 19 pandemic.','Ikorodu','Ikorodu',0.00,1,'default_2.jpg','1',NULL,NULL,'ikorodu',NULL),(4,'Kosofe is a Local Government Area of Lagos State, Nigeria.','kosofe','Kosofe',0.00,0,'ayoola-salako-fjefNIs0230-unsplash.jpg','1',NULL,NULL,'kosofe',NULL),(5,'Mushin is a Local Government Area in Lagos, Nigeria. Mushin is a state of poor sanitation and inadequate housing which have lead to poor living conditions.\r\n\r\nThe smallest donation can make a huge difference.','Mushin','Mushin',0.00,0,'muhammadtaha-ibrahim-ma-aji-K32RRhbupME-unsplash.jpg','1',NULL,NULL,'mushin',NULL),(6,'Oshodi - Isolo is a Local Government Area within Lagos State.','Oshodi-Isolo','Oshodi - Isolo',0.00,0,'omotayo-kofoworola-6QbwPeoaMSg-unsplash.jpg','1',NULL,NULL,'oshodi-isolo',NULL),(7,'Surulere is a residential and commercial Local Government Area located on the mainland of Lagos in Lagos State, Nigeria, with an area of 23 km2 (8.9 sq mi)','Surulere','Surulere',0.00,0,'stephen-olatunde-EBcKOqWzc9M-unsplash.jpg','1',NULL,NULL,'surulere',NULL),(8,'Agege is a suburb and local government area in the Ikeja Division of Lagos State.','Agege','Agege',0.00,0,'dami-akinbode-mxfzQRCBQ5M-unsplash.jpg','1',NULL,NULL,'agege',NULL),(9,'Ifako-Ijaiye is a city and local government area in Lagos.','Ifako-Ijaiye','Ifako - Ijaiye',0.00,0,'dami-akinbode-pwMCmK_6-OI-unsplash.jpg','1',NULL,NULL,'ifako-ijaiye',NULL),(10,'Amuwo-Odofin is a local government area in the Badagry Division, Lagos State, Nigeria.','Amuwo-Odofin','Amuwo-Odofin',0.00,0,'amuwo.jpg','1',NULL,NULL,'amuwo-odofin',NULL),(11,'Lagos Mainland is a local government area in the Lagos Division of Lagos State, Nigeria.','Lagos Mainland','Lagos Mainland',0.00,0,'surulere.jpg','1',NULL,NULL,'lagos-mainland',NULL),(12,'Ikeja is the capital of Lagos State in southwestern Nigeria.','Ikeja','Ikeja',0.00,0,'ikeja.jpg','1',NULL,NULL,'ikeja',NULL),(13,'Eti-Osa is a Local Government Area of Lagos State in Nigeria.','Eti-Osa','Eti-Osa',0.00,0,'eti-osa.jpg','1',NULL,NULL,'eti-osa',NULL),(14,'Lagos Island','Lagos Island','Lagos Island',0.00,0,'lagos_island.jpg','1',NULL,NULL,'lagos-island',NULL),(15,'Ibeju - Lekki','Ibeju - Lekki','Ibeju - Lekki',0.00,0,'ibeju_lekki.jpg','3',NULL,NULL,'ibeju-lekki',NULL),(16,'Abeokuta is the state capital of Ogun State in southwest Nigeria','Abeokuta','Abeokuta',0.00,0,'Abeokuta_Picture.jpg','1',NULL,NULL,'E4CE',NULL),(17,'Makoko is a neighbourhood across the Third Mainland Bridge located on the coast of mainland Lagos. It is built on stilts along the Lagoon and the rest is on the Land. Considered the world\'s biggest floating slum it is spread out beneath the world\'s most traveled bridge in West Africa. \r\n\r\nThe population estimates vary from 40,000 to as high as 300,000 and sometimes to as much as 1,000,000. Nobody really knows as there\'s no credible data available. Makoko silently incubates the world\'s largest slum village, earning between 15,000 to 35000 Naira monthly. Most Makoko members live below the poverty line and settle for menial jobs like smoking fish, carting load, petty trading, canoe rides and fish farming.','Lagos Mainland - Makoko','Lagos Mainland - Makoko',0.00,1,'IMG_1013.JPG','1',NULL,NULL,'Makoko',NULL),(18,'Ijebu-Ode is a town in Ogun State, South Westhern geopolitical zone in Nigeria. An estimated 80% - 90% of the population live below the poverty line.','Ijebu-Ode, Ogun','Ijebu-Ode, Ogun',0.00,1,'Screenshot_2021-03-15_at_23.37.37.png','1',NULL,NULL,'Ijebu-Ode',NULL);
